import './homeproducts.scss'
const HomeProducts = () => {
    return (
        <div className='home-products'>
                <div className='home-about-content'>
                <h2>Products</h2>
                <div className='product-cards'></div>
            </div>
        </div>
    )
}

export default HomeProducts;
